import React, { Component } from 'react';
import './App.css';

class App extends Component {
	constructor(props) {
		super(props);
		console.log('this is initializer');

		this.state = { row };
	}
	render() {
		return (
			<div className="App">
				<table className="titleBar">
					<tbody>
						<tr>
							<td>
								<img alt="app icon" width="50" src="green_app_icon.svg" />
							</td>
							<td width="8">
								<h1>Movies Search</h1>
							</td>
						</tr>
					</tbody>
				</table>

				<input
					style={{
						fontSize: 24,
						display: 'block',
						width: '99%',
						paddingTop: 8,
						paddingBottom: 8,
						paddingLeft: 16,
					}}
					placeholder="Enter search term"
				/>
				{this.state.rows}
			</div>
		);
	}
}

export default App;
